import React from 'react'
import SearchBar from 'material-ui-search-bar'
import InnerNavbar from '../Components/InnerNavbar'
const Search = ()=>{
    return(<div>
    <InnerNavbar />
    <input id="searchbar" type="text" placeholder="Search.."></input>
    Search</div>)
}
export default Search;
